DROP TABLE IF EXISTS `events_ex`;

CREATE TABLE `events_ex` (
  `uid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Event ID',
  `description` text NOT NULL COMMENT 'Event description',
  `dtstart` datetime NOT NULL COMMENT 'Event starts time',
  `dtend` datetime NOT NULL COMMENT 'Event ends time',
  `resources` text NOT NULL COMMENT 'Resources are included in event',
  `organizer` varchar(50) NOT NULL COMMENT 'Ower of the event',
  `rec_type` varchar(64) NOT NULL COMMENT 'Event is created time',
  `event_length` int(11) DEFAULT NULL,
  `event_pid` int(11) DEFAULT NULL,
  `timeoffset` int(11) NOT NULL DEFAULT '0',
  `snotification` tinyint(4) NOT NULL DEFAULT '0',
  `enotification` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`uid`)
) ENGINE=MyISAM AUTO_INCREMENT=1304 DEFAULT CHARSET=latin1;

