/*Table structure for table `stc_inventory_chassis` */

DROP TABLE IF EXISTS `stc_inventory_chassis`;

CREATE TABLE `stc_inventory_chassis` (
  `Site` varchar(6) NOT NULL DEFAULT '',
  `Dept` varchar(45) NOT NULL DEFAULT 'TBD',
  `Hostname` varchar(15) NOT NULL DEFAULT '',
  `Model` varchar(10) NOT NULL DEFAULT '',
  `PartNum` varchar(10) NOT NULL DEFAULT '',
  `Status` varchar(20) NOT NULL DEFAULT '',
  `SlotCount` varchar(10) NOT NULL DEFAULT '',
  `ControllerHwVersion` varchar(10) NOT NULL DEFAULT '',
  `BackplaneHwVersion` varchar(10) NOT NULL DEFAULT '',
  `FirmwareVersion` varchar(10) NOT NULL DEFAULT '',
  `SerialNum` varchar(10) NOT NULL DEFAULT '',
  `Property` char(10) NOT NULL DEFAULT 'TBD',
  `SO` char(20) NOT NULL DEFAULT '',
  `SOStart` varchar(30) NOT NULL DEFAULT '',
  `SOEnd` varchar(30) NOT NULL DEFAULT '',
  `Notes` varchar(50) NOT NULL DEFAULT 'None',
  `LastScan` varchar(30) NOT NULL DEFAULT '',
  `DiskUsed` varchar(10) NOT NULL DEFAULT '',
  `TotalDiskSize` varchar(10) NOT NULL DEFAULT '',
  `DiskFree` varchar(10) NOT NULL DEFAULT '',
  `LoanerNotificationDate` varchar(30) NOT NULL DEFAULT '',
  `Location` varchar(45) NOT NULL DEFAULT 'TBD',
  PRIMARY KEY (`Hostname`)
