/*Table structure for table `stc_inventory_portgroup` */

DROP TABLE IF EXISTS `stc_inventory_portgroup`;

CREATE TABLE `stc_inventory_portgroup` (
  `Site` varchar(5) NOT NULL DEFAULT '',
  `Dept` varchar(45) NOT NULL DEFAULT 'TBD',
  `Hostname` varchar(15) NOT NULL DEFAULT '',
  `SlotIndex` int(10) unsigned NOT NULL DEFAULT '0',
  `PortGroupIndex` int(10) unsigned NOT NULL DEFAULT '0',
  `PortIndex` int(10) NOT NULL DEFAULT '0',
  `ResEnd` varchar(30) NOT NULL DEFAULT '',
  `Connection` char(255) NOT NULL DEFAULT 'TBD',
  `Name` varchar(45) NOT NULL DEFAULT '',
  `PersonalityCardType` varchar(30) NOT NULL DEFAULT '',
  `TransceiverType` varchar(30) NOT NULL DEFAULT '',
  `Status` varchar(45) NOT NULL DEFAULT '',
  `FirmwareVersion` varchar(45) NOT NULL DEFAULT '',
  `OwnershipState` varchar(45) NOT NULL DEFAULT '',
  `OwnerHostname` varchar(45) NOT NULL DEFAULT '',
  `OwnerUserId` varchar(45) NOT NULL DEFAULT '',
  `OwnerTimestamp` varchar(45) NOT NULL DEFAULT '',
  `Notes` varchar(50) NOT NULL DEFAULT 'None',
  `LastScan` varchar(30) NOT NULL DEFAULT '',
  `ConnectionType` varchar(20) NOT NULL DEFAULT '',
  `PeerHost` varchar(30) NOT NULL DEFAULT '',
  `PeerModule` varchar(30) NOT NULL DEFAULT '',
  `PeerPort` varchar(20) NOT NULL DEFAULT '',
  `Comments` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`Hostname`,`SlotIndex`,`PortGroupIndex`,`PortIndex`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

